    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <a className="navbar-brand" href="#" target="_blank">
        <img src="" width="30" height="30" />
          </a>
          <Link TO>MERN STACK TODO APP</Link>
    </nav>
  );
};

export default Navbar;
